import Player from './component/Player';
import TimeChallenge from './component/TimerChallenge';



function App() {
  return (
    <>
      <Player />
      <div id="challenges">
        <TimeChallenge  title="Easy" targetTime={1}/>
        <TimeChallenge  title="Not easy" targetTime={5}/>


      </div>
    </>
  );
}

export default App;
